import { PanelMenu } from 'primereact/panelmenu';

const Quests = () => {
    const items: object[] = [
        {
           label:'Manage Quests',
           icon:'pi pi-fw pi-file',
           items:[
              {
                 label:'New',
                 icon:'pi pi-plus',
              },
              {
                 label:'Delete',
                 icon:'pi pi-fw pi-trash'
              },
           ]
        }
     ];

    return ( 
        <>
            <PanelMenu model={items}/>
        </>
     );
}

export default Quests;
